<template>
  <div class="app-container">
    <HeaderMain />
    <main>
      <div class="main-container">
        <RouterView />
      </div>
    </main>
  </div>
</template>

<script setup>
  import { provide, onBeforeMount } from 'vue';
  import HeaderMain from './components/HeaderMain.vue'
  import { RouterView } from 'vue-router'
  import store from '@/store'

  provide('store', store)

  // Before mounting pull last stored state for sessionStorage and apply to application state
  onBeforeMount(() => {
    const sessionState = sessionStorage.getItem("vl-sr-state")
    
    if (sessionState !== null) {
      store.state = JSON.parse(sessionState)
    }
  })

  // Before the app is left, update sessionStorage to current application state
  // window.addEventListener("beforeunload", function() {
  //   sessionStorage.setItem("vl-sr-state", JSON.stringify(store.state))
  // });
</script>

